import '../../assets/webStyles/form.css'

function FormIdeas(){
    return(
        <div className='Form-content'>
            <div className='Title-content'>
                <h1>Comparte tus ideas</h1>
            </div>
            <div className='Name-content'>
                <input className='Input-name'></input>
            </div>
            <div className='Email-content'>
                <input className='Input-Email'></input>
            </div>
            <div className='Rol-content'>
                <input className='Input-Rol'></input>
            </div>
        </div>
    );
}
export default FormIdeas;
